import React, { useState, useCallback } from 'react';
import { useDropzone } from 'react-dropzone';
import {
  Container,
  Box,
  Typography,
  Paper,
  Button,
  TextField,
  CircularProgress,
  Alert,
  Snackbar,
  LinearProgress
} from '@mui/material';
import axios from 'axios';
import './App.css';

function App() {
  const [file, setFile] = useState<File | null>(null);
  const [title, setTitle] = useState('');
  const [isConverting, setIsConverting] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [success, setSuccess] = useState<string | null>(null);
  const [trainingProgress, setTrainingProgress] = useState(0);
  const [estimatedTime, setEstimatedTime] = useState(0);
  const [currentStep, setCurrentStep] = useState('');
  const [statusCheckInterval, setStatusCheckInterval] = useState<NodeJS.Timeout | null>(null);

  const onDrop = useCallback((acceptedFiles: File[]) => {
    if (acceptedFiles.length > 0) {
      setFile(acceptedFiles[0]);
    }
  }, []);

  const { getRootProps, getInputProps, isDragActive } = useDropzone({
    onDrop,
    accept: {
      'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet': ['.xlsx'],
      'application/vnd.openxmlformats-officedocument.wordprocessingml.document': ['.docx'],
      'application/pdf': ['.pdf']
    },
    multiple: false
  });

  const checkTrainingStatus = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/training-status');
      const { progress, estimated_time, current_step, error, is_training } = response.data;
      
      setTrainingProgress(progress);
      setEstimatedTime(estimated_time);
      setCurrentStep(current_step);

      if (error) {
        setError(error);
        setIsConverting(false);
        if (statusCheckInterval) {
          clearInterval(statusCheckInterval);
        }
      }

      if (progress === 100 || !is_training) {
        setIsConverting(false);
        if (statusCheckInterval) {
          clearInterval(statusCheckInterval);
        }
        setSuccess('File processed and published successfully!');
      }
    } catch (err) {
      setError('Failed to check training status');
      setIsConverting(false);
      if (statusCheckInterval) {
        clearInterval(statusCheckInterval);
      }
    }
  };

  const handleConvert = async () => {
    if (!file || !title) {
      setError('Please select a file and enter a title');
      return;
    }

    setIsConverting(true);
    setError(null);
    setSuccess(null);
    setTrainingProgress(0);

    try {
      const formData = new FormData();
      formData.append('file', file);
      formData.append('title', title);

      const response = await axios.post('http://localhost:5000/api/publish', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });

      if (response.data.status_url) {
        // Start checking training status every second
        const interval = setInterval(checkTrainingStatus, 1000);
        setStatusCheckInterval(interval);
      }
    } catch (err) {
      setError('Failed to start processing');
      setIsConverting(false);
    }
  };

  const handleCloseSnackbar = () => {
    setError(null);
    setSuccess(null);
  };

  return (
    <Container maxWidth="md">
      <Box sx={{ my: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          File Converter
        </Typography>

        <Paper
          {...getRootProps()}
          sx={{
            p: 3,
            textAlign: 'center',
            cursor: 'pointer',
            backgroundColor: isDragActive ? '#f0f0f0' : 'white',
            border: '2px dashed #ccc',
            mb: 2
          }}
        >
          <input {...getInputProps()} />
          {isDragActive ? (
            <Typography>Drop the file here...</Typography>
          ) : (
            <Typography>
              Drag and drop a file here, or click to select a file
            </Typography>
          )}
        </Paper>

        {file && (
          <Box sx={{ mb: 2 }}>
            <Typography>Selected file: {file.name}</Typography>
          </Box>
        )}

        <TextField
          fullWidth
          label="Title"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
          sx={{ mb: 2 }}
        />

        {isConverting && (
          <Box sx={{ width: '100%', mb: 2 }}>
            <Typography variant="body2" gutterBottom>
              {currentStep} - {trainingProgress}% complete
            </Typography>
            <Typography variant="body2" color="text.secondary" gutterBottom>
              Estimated time remaining: {estimatedTime} seconds
            </Typography>
            <LinearProgress variant="determinate" value={trainingProgress} />
          </Box>
        )}

        <Button
          variant="contained"
          color="primary"
          onClick={handleConvert}
          disabled={!file || !title || isConverting}
          sx={{ mb: 2 }}
        >
          {isConverting ? (
            <>
              <CircularProgress size={24} sx={{ mr: 1 }} />
              Processing...
            </>
          ) : (
            'Convert and Publish'
          )}
        </Button>

        <Snackbar
          open={!!error || !!success}
          autoHideDuration={6000}
          onClose={handleCloseSnackbar}
        >
          <Alert
            onClose={handleCloseSnackbar}
            severity={error ? 'error' : 'success'}
            sx={{ width: '100%' }}
          >
            {error || success}
          </Alert>
        </Snackbar>
      </Box>
    </Container>
  );
}

export default App;
